import React, { Component } from "react";

class NrWomen extends Component {
  render() {
      // console.log("A",this.props.nrWomenName)
    return (
                <li className="nrWomenItem">
                    <a className="nrWomenLink" href>
                      {this.props.nrSportsName}
                    </a>
                  </li>
    )
  }
}

export default NrWomen;
